import { YMaps, Map,GeolocationControl,FullscreenControl,RouteButton,ZoomControl,Placemark} from 'react-yandex-maps';

const App = () => (
<YMaps>
  <Map
  style={{width:'100%',height:'10%'}}
    query={{ lang: 'en' }}
    defaultState={{
      center: [55.751574, 37.573856],
      zoom: 9,
      controls: [],
    }}
  >
    <Placemark geometry={[55.684758, 37.738521]} />
    <GeolocationControl options={{ float: 'left' }} />
    <FullscreenControl />
    <RouteButton options={{float:'left',bottom:'0'}} />
    <ZoomControl options={{ float: 'right' }} />

  </Map>
</YMaps>
);
export default App;
